import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

class App extends React.Component {

  state = ReactDOM.useState({
    checkedA: true,
    checkedB: true,
    checkedF: true,
    checkedG: true,
  });

  render() {
    return (
      <div>
        <form>
          <label>
            <h1>Пицца</h1>
            <option value="checkbox" type="checkbox"> Сырная</option>
            <option value="checkbox" type="checkbox"> Гавайская</option>
            <option value="checkbox" type="checkbox"> Пепперони</option>
            <option value="checkbox" type="checkbox"> Ягоды</option>
            <option value="checkbox" type="checkbox"> Морская</option>
            <option value="checkbox" type="checkbox"> Бекон</option>
            <option value="checkbox" type="checkbox"> Четыре сыра</option>
          </label>
        </form>
      </div>
    );
  }
}
export default App;
